import React from "react";
import Header from "./header";
import Footer from "./footer";
import Note from "./note";
import notes from "../notes";

function createNote(noteItem){
    return (
        <Note 
            titl={noteItem.title}
            conten={noteItem.content}
        />
    )
}

function App(){
    return (
        <div>
            <Header />
            notes.map(createNote())
            <Footer />
        </div>
    )
}

export default App;
